function Signin() {
  return (
    <div id="wraper">
      <div className="card">
        <p>Sign in</p>
      </div>
      <style jsx>{`
        #wrapper {
          display: flex;
          width: 100%;
          background-color: #9482a3;
        }

        .card {
          color: black;
          display: flex;
          border-radius: 4px;
          width: 30%;
          background-color: white;
        }
      `}</style>
    </div>
  );
}

Signin.Layout = (props) => <div>{props.children}</div>

export default Signin;
